import Nav from "./nav";
import fetchAPI from "../lib/api";

const cats = () => {
  fetchAPI("vidCatogires")
}

const Layout = ({ children, categories, seo, VidCatogories }) => (
  <>
    <Nav categories={ categories} vidCatogories= {VidCatogories}/>
    {children}
  </>
);

export default Layout;
